import React from 'react'
import styled from 'styled-components'
import {Context} from '../Context' 
function Infodivtog() {


  const Alldiv = styled.div`
   width : 100%;
   height : 70px;
   border : solid 1px white;
   margin-top : 10px;
   display  : flex;
    justify-content : space-around
  ` 

  const Indiv = styled.div`
    width : auto;
    height  : 70px;
    display  : flex;
    align-items : center;
    justify-content : center;
    color : white;
    font-size : 20px;
    font-weight : 700;
    font-family : sans-serif;
    cursor : pointer;
    &:hover {
    color : red
  }
  `



  return (
    <div>
      <Alldiv>
        <Indiv>
        <p>Last</p>
        </Indiv>
        <Indiv>
        <p>Find room</p>
        </Indiv>
        <Indiv>
        <p>create room</p>
        </Indiv>
       </Alldiv>      
    </div>
  )
}

export default Infodivtog
